    const fetchUser = async ()=>{
      await axios.get("/64a6cf351d7943da1297bc0a");
      // console.log(res);   
      // setUser(res.data); 
    }
    fetchUser();
  },[props.userId])
  return (
    <div className='Note'>
        <h1>{props.title}</h1>
        <p>{props.desc}</p>
        <button onClick={handleclick}>delete</button>
    </div>
  )
}
